function Form (){
    return(
        <div className="form">
        <h2>ENTRE EM CONTATO !</h2>
          <form>
            <div className="items-form">
             <MapView
               initialRegion={{
               latitude: 37.78825,
               longitude: -122.4324,
               latitudeDelta: 0.0922,
               longitudeDelta: 0.0421,
    }}
  />
            </div>
          </form>
        </div>
        
    )
}

export default Form;
